import React, {useState} from 'react';
import './App.css';
import {LocalStorage} from "./LocalStorage";

function App() {


    const [value,setValue]=useState(0)

const onClickHandler = ()=>{
        setValue(value+1)
}


    return (
        <div className="App">
            <LocalStorage value={value}/>
    <button onClick={onClickHandler}>inc</button>




        </div>
    );
}

export default App;
